import React, {useState} from 'react';
import Axios from "axios"



const Login = () => {


    const [UserNameReg, SetUserNameReg] = useState('');
    const [UserPasswordReg, SetUserPasswordReg] = useState('');

const log = () => {
    Axios.post("http://localhost:3001/login" , {username : UserNameReg,
    password:UserPasswordReg }).then(response =>{
        console.log(response)

    })
}
    return (
        <div className="form">
            <div className="form-body">
                <div className="username">
                    <label className="form__label" htmlFor="firstName">First Name </label>
                    <input className="form__input" type="text" id="firstName" placeholder="First Name" onChange={(e)=>{
                        SetUserNameReg(e.target.value)
                    }}/>
                </div>
                <div className="password">
                    <label className="form__label" htmlFor="password">Password </label>
                    <input className="form__input" type="password" id="password" placeholder="Password" onChange={(e)=>
                    {
                       SetUserPasswordReg(e.target.value)
                    }}/>
                </div>

            </div>
            <div className="footer">
                <button type="submit" className="btn" onClick={log}>Login</button>
            </div>
        </div>
    );
};

export default Login;
